import React from "react";
import Navbar from "../Navbar";

export default function Home() {
    return (
        <>
            <Navbar />
            <div className="container text-center">
                <h1 className="display-4 pb-3">Create Table</h1>

                <form>
                    <input></input>
                    <img className="ps-3 h" src="plus-square.svg" alt="add table"></img>

                </form>

            </div>

        </>
    )
}
